from datetime import date
from pydantic import BaseModel

class Settings(BaseModel):
    authjwt_secret_key : str = ""


class LoginModel(BaseModel):
    username : str 
    password : str 


class UserModel(BaseModel):
    id : int 
    username : str 
    email : str 
    first_name : str 
    last_name : str
    password : str 